import Content from "./UserMainPage/Content.js"
import Navbar from "./UserMainPage/Navbar/Navbar";
import Footer from "./UserMainPage/Footer/Footer";
import { auth } from "./Auth/firebase.js";



export default function Home() {
  const PrivateRoute = ({ children }) => {
    const { userLoggedIn } = useAuth();
    return userLoggedIn ? children : <Navigate to="/home" />;
  };
  return (
    <>
    <Route path="/register" element={<PrivateRoute><RegisterPage /></PrivateRoute>} />
     <div>
      {auth.currentUser.email ? (
        <p>Email: {auth.currentUser.email}</p>
      ) : (
        <p>No user is logged in</p>
      )}
    </div>
      <Navbar />
      <Content />
      <Footer />
    </>
  );
}
